import React, { Component } from 'react';
import { Icon } from '@blueprintjs/core';
import { IconNames } from '@blueprintjs/icons';

const NavElement = ({ name, iconName, active }) => (
  <div className="sideNavElement">
    <Icon icon={IconNames[iconName]} iconSize="15" color="rgba(78, 185, 255, 1)" style={{ verticalAlign: 'baseline' }} />
    <span>
    &nbsp;&nbsp;
      {name}
    </span>
  </div>
);
export default class extends Component {
  state = { }

  render() {
    const navElements = [{ iconName: 'PERSON', name: 'Profile', active: true },
      { iconName: 'HOME', name: 'Classes', active: false },
      { iconName: 'COG', name: 'Settings', active: false },
    ];
    return (
      <div className="sideNav">
        {
          navElements.map((obj) => {
            return (<NavElement name={obj.name} iconName={obj.iconName} active={obj.active} />);
          })
        }
      </div>
    );
  }
}
